import React from 'react';
import styles from './Site.module.css'
import {Navigate, NavLink, Route, Routes} from "react-router-dom";
import {PageOne} from "./pages/PageOne";
import {PageTwo} from "./pages/PageTwo";
import {PageThree} from "./pages/PageThree";
import {Error404} from "./pages/Error404";


export const Site = () => {
    return (
        <div>
            <div className={styles.header}><h1>HEADER</h1></div>
            <div className={styles.body}>
                <div className={styles.nav}>
                    <div ><NavLink className={(isActive)=>isActive? styles.active :styles.navLink} to={'page1/'}>One Page</NavLink ></div>
                    <div><NavLink className={(isActive)=>isActive? styles.active :styles.navLink} to={'page2/'}>Two Page</NavLink ></div>
                    <div><NavLink  className={(isActive)=>isActive? styles.active :styles.navLink}to={'page3/'}>Three Page</NavLink ></div>

                </div>
                <div className={styles.content}>
               <Routes>
                   <Route path={'/'} element={<Navigate to={'page1/'}/>}/>
                   <Route path={'page1/'} element={<PageOne/>}/>
                   <Route path={'page2/'} element={<PageTwo/>}/>
                   <Route path={'page3/'} element={<PageThree/>}/>
                   <Route path={'/*'} element={<Error404/>}/>
               </Routes>
                </div>
            </div>
        </div>
    );
};
